import React from 'react';
import ReactDOM from 'react-dom';
import MichaelScott from './MichaelScott.png'

const CharacterCard = () => {
  return (
    <div class="ui card">
      <div class="image">
        <img src={MichaelScott} alt="Michael Scott" />
      </div>
      <div class="content">
        <h4 class="header">Michael Scott</h4>
        <div class="description">
          Regional Manager
        </div>
      </div>
    </div>
  );
};

export default CharacterCard;
